            this.currentPlayerFieldVariantName = '';
            this.currentPlayerFieldVariantIndex = 0;

            this.achievements = [];
            this.achievementsGroups = [];
            this.playerAchievements = [];

            this.currentAchievementIndex = 0;
            this.currentAchievementId = 0;
